import React from 'react';

function ListProducts(props) {
    return (

          <div>
            <h2>{props.title}</h2>
            <img src={props.image} alt={props.alt}/>
            <p>{props.price}</p>
            <p>{props.description}</p>
          </div>
    )
}

export default ListProducts;
